INFO:

General Commander is an introductory war strategy game which brings a unique mix of scale, combat dynamics, and force management. An intuitive combination of rules and controls will give beginning wargamers and real time strategy fans the opportunity to simulate Germany's famous last Blitzkrieg from either side. Evaluate the tactical situation while monitoring your overall strategy over real scale 3D maps, with high quality graphics and effects.  

Installation:

1. Unpack release 
2. Mount image or burn it                                       
3. Install                                                             
4. When asked for serial, just input something - DON'T LEAVE IT EMPTY!                                      
5. Play the game                                                




